						slideBy: 				1,
						dots: 					true,
						dotsEach: 				false,
						dotData: 				false,
						lazyLoad: 				false,
						lazyContent: 			false,
						autoplay: 				false,
						autoplayTimeout: 		3000,
						autoplayHoverPause: 	false,
						smartSpeed: 			250,
						//fluidSpeed: 			'Number',
						autoplaySpeed: 			false,
						navSpeed: 				false,
						//dotsSpeed: 			'Number/Boolean',
						dragEndSpeed: 			false,
						callbacks: 				true,
						responsiveRefreshRate: 	200,
						responsiveBaseElement: 	'#wrapper',
						responsiveClass: 		true,
						video: 					false,
